import SHOP_DATA from './shop.data';

const INITIAL_STATE =  {
    collections: SHOP_DATA
};


const shopReducer = (statae = INITIAL_STATE, action) => {
    switch(action.type){
        default:
            return statae;
    }
}

export default shopReducer;
